.messagebleft-container {
    transition: all 3s ease;
    transition-duration: 2s;
    transition-property: top, right, bottom, left, opacity;
    font-family: Roboto, sans-serif;
    font-size: 20px;
    min-height: 12px !important;
    background: linear-gradient(rgb(0,100,0) 15%, rgb(34,139,34) 50%, rgb(0,100,0) 85%) !important;
    position: fixed;
    display: flex;
    justify-content: space-between;
    align-items: center;
    color: #000 !important;
    line-height: 18px;
    padding: 15px 24px;
    bottom: -100px;
    top: -100px;
    opacity: 0;
    z-index: 9999;
    border-radius: 25px !important;
    border: 2px solid #32CD32 !important;
    box-shadow: inset 0px 0px 0px 1px rgb(46,139,87), inset 0px 2px 0px 0px rgb(0,128,0), inset 0px 0px 0px 2px rgb(46,139,87), 3px 3px 3px 1px rgb(0 0 0 / 20%) !important;
 
}

.messagebleft-container .action {
    background: inherit;
    display: inline-block;
    font-size: inherit;
    text-transform: uppercase;
    color: #4caf50;
    margin: 0 0 0 24px;
    padding: 0;
    min-width: min-content;
    cursor: pointer;
}

@media(min-width: 640px) {
    .messagebleft-container {
        min-width: 288px;
        max-width: 568px;
        display: inline-flex;
        border-radius: 2px;
        margin: 24px;
    }
}

@media(max-width: 640px) {
    .messagebleft-container {
        left: auto;
        right: auto;
        width: calc(100% - 24px);
        margin: 0 12px;
    }
}

.messagebleft-pos.bottom-center {
    top: auto !important;
    bottom: 0;
    left: 50%;
    transform: translate(-50%, 0);
}

.messagebleft-pos.bottom-left {
    top: auto !important;
    bottom: 0;
    left: 12px;
}

.messagebleft-pos.bottom-right {
    top: auto !important;
    bottom: 0;
    right: 12px;
}

.messagebleft-pos.top-left {
    bottom: auto !important;
    top: 0;
    left: 12px;
}

.messagebleft-pos.top-center {
    bottom: auto !important;
    top: 0;
    left: 50%;
    transform: translate(-50%, 0);
}

.messagebleft-pos.top-right {
    bottom: auto !important;
    top: 0;
    right: 12px;
}

@media(max-width: 640px) {
    .messagebleft-pos.bottom-center,
    .messagebleft-pos.top-center {
